let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = let sum = (fst x) + (snd x) + (fst a )in 
        if  sum > 9 then (1, (sum - 10 ) :: (snd a))
        else (0, (sum ):: (snd a))
    in
    let base = (0,[]) in
    let args = List.combine (List.rev (0::l1)) (List.rev (0::l2)) in
    let (_, res) = List.fold_left f base args in
      res
  in 
    removeZero (add (padZero l1 l2))

